import React from "react";
import "./Navbar.css";
import { NavLink } from "react-router-dom";

// svg files
import HomeIcon from "../assets/home.svg";
import WorkoutIcon from "../assets/findworkout.svg";
import MeetIcon from "../assets/meetothers.svg";
import ProfileIcon from "../assets/profile.svg";
import HomeIconActive from "../assets/home-active.svg";
import WorkoutIconActive from "../assets/findworkout-active.svg";
import MeetIconActive from "../assets/meetothers-active.svg";
import ProfileIconActive from "../assets/profile-active.svg";

const Navbar: React.FC = () => {
  return (
    <nav className="bottom-navbar">
      <ul>
        <li>
          <NavLink to="/" className={({ isActive }) => (isActive ? "active" : "")}>
            <img src={isActive ? HomeIconActive : HomeIcon} alt="Home" className="icon" />
            <span className="label">Home</span>
          </NavLink>
        </li>
        <li>
          <NavLink to="/findworkout" className={({ isActive }) => (isActive ? "active" : "")}>
            <img src={isActive ? WorkoutIconActive : WorkoutIcon} alt="Workout" className="icon" />
            <span className="label">Find Workout</span>
          </NavLink>
        </li>
        <li>
          <NavLink to="/meetothers" className={({ isActive }) => (isActive ? "active" : "")}>
            <img src={isActive ? MeetIconActive : MeetIcon} alt="Meet Others" className="icon" />
            <span className="label">Meet Others</span>
          </NavLink>
        </li>
        <li>
          <NavLink to="/profile" className={({ isActive }) => (isActive ? "active" : "")}>
            <img src={isActive ? ProfileIconActive : ProfileIcon} alt="Profile" className="icon" />
            <span className="label">Profile</span>
          </NavLink>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
